    return (
        <div className='container m-auto text-center'>
            <h1 style={{color: 'blue'}}>FAKE STORE API CART</h1>
            <div>
                    <Loading/> : {product.map((item,index)=>{
                        return <Product key={index} item={item}/>
                    })}

            </div>
        </div>
    )
}

export default Card
